        />
      </View> */}
       <View style={styles.InputContainer}>
       <TextInput
        style={styles.input}
        placeholder="תעודת זהות"
        value={volunteerId}
        onChangeText={setVolunteerId}
      />
      </View>
      <View style={styles.InputContainer}>
      <TextInput
        style={styles.input}
        placeholder="שם מלא"
        value={volunteerName}
        onChangeText={setVolunteerName}
      />
      </View>
      <View style={styles.InputContainer}>
      <TextInput
        style={styles.input}
        placeholder="פלאפון"
        value={phone}
        onChangeText={setPhone}
      />

      </View>
      <View style={styles.InputContainer}>
      <TextInput
        style={styles.input}
        placeholder="אימייל"
        value={email}
        onChangeText={setEmail}
      />
      </View>

      <View style={styles.InputContainer}>
      <TextInput
        style={styles.input}
        placeholder="כתובת"
        value={address}
        onChangeText={setAddress}
      />
      </View>
      <View style={styles.InputContainer}>
      <TextInput
        style={styles.input}
        placeholder="עיר"
        value={city}
        onChangeText={setCity}
      />
      </View>
      <View style={styles.InputContainer}>
      <TextInput
        style={styles.input}
        placeholder="תחום התנדבות"
        value={fieldOfVolunteering}
        onChangeText={setFieldOfVolunteering}
      />
      </View>
      <View style={styles.InputContainer}>
      <TextInput
        style={styles.input}
        placeholder="סניף"
        value={branch}
        onChangeText={setBranch}
      />
      </View>
      <View style={styles.InputContainer}>
      <TextInput
        style={styles.input}
        placeholder="האם יש רכב נכים"
        value={disabledVehicle}
        onChangeText={setDisabledVehicle}
      />

      </View>
      <TouchableOpacity
        style={[styles.facebookContainer, {marginTop: 50}]}
        onPress={() => onRegister()}>
        <Text style={styles.facebookText}>Sign Up</Text>
      </TouchableOpacity>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
  },
  title: {
    fontSize: AppStyles.fontSize.title,
    fontWeight: 'bold',
